import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import SwitchBtn from './components/switchBtn/switchBtn.js';
import Grid from '@material-ui/core/Grid';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
class App extends Component {
  constructor(props){
    super(props);
    this.state = {

    }
  }

  render() {
    return (
      <div className="App">
        <p>Läuft</p>
        <Grid container direction="row" justify="center" alignItems="flex-end">
          <Grid item xs={3}>
            <Card>
              <CardContent>
                <p>Hat jemand Hunger?</p>
              </CardContent>
              <SwitchBtn light={0}/>
            </Card>
          </Grid>
          <Grid item xs={3}>
            <Card>
              <CardContent>
                <p>Jemand in der Küche?</p>
              </CardContent>
              <SwitchBtn light={1}/>
            </Card>
          </Grid>
          <Grid item xs={3}>
            <Card>
              <CardContent>
                <p>Rauchen?</p>
              </CardContent>
              <SwitchBtn light={2}/>
            </Card>
          </Grid>
          <Grid item xs={3}>
            <Card><SwitchBtn light={3}/></Card>
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default App;
